import React, { useEffect } from 'react';
import { useSelector, useDispatch } from 'react-redux';
import { 
    Grid, 
    Container, 
    Typography, 
    Box,
    Paper,
    Divider,
    useTheme
} from '@mui/material';
import WebsiteMonitoring from './WebsiteMonitoring';
import LogManagement from './LogManagement';
import APMDashboard from './APMDashboard';
import RUMDashboard from './RUMDashboard';
import DatabaseMetrics from './DatabaseMetrics';
import DiskSpaceMetrics from './DiskSpaceMetrics';

const Dashboard = () => {
    const dispatch = useDispatch();
    const { data, status, error } = useSelector((state) => state.awsServices);
    const theme = useTheme();

    useEffect(() => {
        const fetchData = async () => {
            try {
                const [
                    statusResponse, 
                    dbMetricsResponse, 
                    diskMetricsResponse,
                    apmResponse,
                    rumResponse
                ] = await Promise.all([
                    fetch('http://localhost:5001/api/status'),
                    fetch('http://localhost:5001/api/db-metrics'),
                    fetch('http://localhost:5001/api/disk-metrics'),
                    fetch('http://localhost:5001/api/apm-metrics'),
                    fetch('http://localhost:5001/api/rum-metrics')
                ]);

                const statusData = await statusResponse.json();
                const dbMetricsData = await dbMetricsResponse.json();
                const diskMetricsData = await diskMetricsResponse.json();
                const apmData = await apmResponse.json();
                const rumData = await rumResponse.json();

                dispatch(updateData({
                    ...statusData,
                    dbMetrics: dbMetricsData,
                    diskMetrics: diskMetricsData,
                    apmMetrics: apmData,
                    rumMetrics: rumData
                }));
            } catch (error) {
                console.error('Error fetching data:', error);
            }
        };

        fetchData();
        const interval = setInterval(fetchData, 30000);
        return () => clearInterval(interval);
    }, [dispatch]);

    return (
        <Box sx={{ 
            backgroundColor: theme.palette.background.default,
            minHeight: '100vh',
            py: 3
        }}>
            <Container maxWidth="xl">
                {/* Header */}
                <Box mb={4}>
                    <Typography variant="h4" gutterBottom sx={{ 
                        color: theme.palette.primary.main,
                        fontWeight: 'bold'
                    }}>
                        AWS Infrastructure Monitor
                    </Typography>
                    <Divider />
                </Box>

                {/* Main Grid Layout */}
                <Grid container spacing={3}>
                    {/* Website Monitoring - Top Row */}
                    <Grid item xs={12} md={6}>
                        <Paper 
                            elevation={2} 
                            sx={{ 
                                p: 2, 
                                height: '100%',
                                borderRadius: 2,
                                transition: 'transform 0.2s ease-in-out',
                                '&:hover': {
                                    transform: 'translateY(-4px)'
                                }
                            }}
                        >
                            <WebsiteMonitoring data={data?.websites} />
                        </Paper>
                    </Grid>

                    {/* Log Management - Top Row */}
                    <Grid item xs={12} md={6}>
                        <Paper 
                            elevation={2} 
                            sx={{ 
                                p: 2, 
                                height: '100%',
                                borderRadius: 2,
                                transition: 'transform 0.2s ease-in-out',
                                '&:hover': {
                                    transform: 'translateY(-4px)'
                                }
                            }}
                        >
                            <LogManagement logs={data?.logs} />
                        </Paper>
                    </Grid>

                    {/* Application Performance - Middle Row */}
                    <Grid item xs={12} md={6}>
                        <Paper 
                            elevation={2} 
                            sx={{ 
                                p: 2, 
                                height: '100%',
                                borderRadius: 2,
                                transition: 'transform 0.2s ease-in-out',
                                '&:hover': {
                                    transform: 'translateY(-4px)'
                                }
                            }}
                        >
                            <APMDashboard metrics={data?.apmMetrics} />
                        </Paper>
                    </Grid>

                    {/* Real User Monitoring - Middle Row */}
                    <Grid item xs={12} md={6}>
                        <Paper 
                            elevation={2} 
                            sx={{ 
                                p: 2, 
                                height: '100%',
                                borderRadius: 2,
                                transition: 'transform 0.2s ease-in-out',
                                '&:hover': {
                                    transform: 'translateY(-4px)'
                                }
                            }}
                        >
                            <RUMDashboard metrics={data?.rumMetrics} />
                        </Paper>
                    </Grid>

                    {/* Database Performance - Bottom Row */}
                    <Grid item xs={12} md={6}>
                        <Paper 
                            elevation={2} 
                            sx={{ 
                                p: 2, 
                                height: '100%',
                                borderRadius: 2,
                                transition: 'transform 0.2s ease-in-out',
                                '&:hover': {
                                    transform: 'translateY(-4px)'
                                }
                            }}
                        >
                            <DatabaseMetrics metrics={data?.dbMetrics} />
                        </Paper>
                    </Grid>

                    {/* Disk Space Utilization - Bottom Row */}
                    <Grid item xs={12} md={6}>
                        <Paper 
                            elevation={2} 
                            sx={{ 
                                p: 2, 
                                height: '100%',
                                borderRadius: 2,
                                transition: 'transform 0.2s ease-in-out',
                                '&:hover': {
                                    transform: 'translateY(-4px)'
                                }
                            }}
                        >
                            <DiskSpaceMetrics metrics={data?.diskMetrics} />
                        </Paper>
                    </Grid>
                </Grid>

                {/* Loading and Error States */}
                {status === 'loading' && (
                    <Box display="flex" justifyContent="center" mt={4}>
                        <CircularProgress />
                    </Box>
                )}
                {error && (
                    <Box mt={4}>
                        <Alert severity="error">{error}</Alert>
                    </Box>
                )}
            </Container>
        </Box>
    );
};

export default Dashboard;
